import { Provider } from 'react-redux';
import store from '../store';
import Header from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <Provider store={store}>
    <div style={layoutStyle}>
      <Header />
      {props.children}
    </div>
  </Provider>
);

export default Layout;
